'''Goblins''' found in the [[God Wars Dungeon]] are troops for the [[Bandos]]ian army, fighting against the other monsters inside the dungeon. While stronger than most goblins found elsewhere, they are still relatively weak followers of Bandos and often killed for [[kill count]].

The level 12 goblins carrying banners are always passive and are not aggressive even without Bandosian protection. They will run away from the player when approached.

